import React, { Component } from 'react';
import './App.css';
import axios from 'axios';
import Greet from './components/greet'
import Header from './components/header'


class App extends Component{
  render(){
    axios.get('http://localhost:3000/admin/element')
  .then(response => {
    const myElement = response.data;
    // Do something with the retrieved element, e.g. update the state of a React component
  })
  .catch(error => {
    console.log(error);
  });


  return (
    <div className="App">
      <Greet />

      <Header />
    </div>
  );
  }
}

export default App;
